        const{ data } = await axios.get(
            `https://api.themoviedb.org/3/trending/all/day?api_key=${process.env.REACT_APP_API_KEY}`
        )

        console.log(data)
        setContent(data.results);
    }

    useEffect(() => {
       fetchTrending();
    }, [])

